"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Mycoplasma pneumonia in children (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H17479343\">",
"      <span class=\"h1\">",
"       What is Mycoplasma pneumonia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Mycoplasma pneumonia is an infection of the lungs that can cause a cough, fever, sore throat, and other symptoms. This type of pneumonia is slightly different from the type of pneumonia that people normally think of when they hear that term. Mycoplasma pneumonia is caused by different bacteria than run-of-the-mill pneumonia. The symptoms it causes are also slightly different.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17479358\">",
"      <span class=\"h1\">",
"       What are the symptoms of Mycoplasma pneumonia in children?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms of Mycoplasma pneumonia come on slowly in children. At first, a child might have a headache and a mild fever, and just not feel well. Later, the child might get a sore throat and cough. These symptoms are not that different from those of a common cold. But Mycoplasma pneumonia can also cause other symptoms, including:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        A red, bumpy rash",
"       </li>",
"       <li>",
"        Upset stomach, vomiting, or diarrhea",
"       </li>",
"       <li>",
"        Muscle aches",
"       </li>",
"       <li>",
"        Pain in the knees, hips, or other joints",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17479373\">",
"      <span class=\"h1\">",
"       Should my child see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If you think your child has the symptoms described above, see a doctor or nurse right away.",
"     </p>",
"     <p>",
"      Call 9-1-1 for an ambulance if your child:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Stops breathing",
"       </li>",
"       <li>",
"        Starts to turn blue or very pale",
"       </li>",
"       <li>",
"        Has a very hard time breathing (",
"        <a class=\"graphic graphic_figure graphicRef59786 \" href=\"UTD.htm?26/31/27121\">",
"         figure 1",
"        </a>",
"        )",
"       </li>",
"       <li>",
"        Starts grunting",
"       </li>",
"       <li>",
"        Looks like he or she is getting tired from having to work so hard to breathe",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If a doctor or nurse thinks your child might have pneumonia, he or she will do an exam and listen to your child&rsquo;s breathing. He or she might also take an X-ray of your child&rsquo;s chest and run some blood tests.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17479411\">",
"      <span class=\"h1\">",
"       How is Mycoplasma pneumonia treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Mycoplasma pneumonia is treated with a specific type of antibiotic. Antibiotics are medicines that kill bacteria. They are available in pill or liquid form. Make sure that your child takes all of his or her antibiotics, even if he or she starts feeling better before finishing them!",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17479426\">",
"      <span class=\"h1\">",
"       How soon will my child feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most children who are treated with antibiotics start to feel better 2 to 3 days after they start taking the medicine. Even so, your child might still feel tired or have a cough for a few weeks or even months after being treated. It might also be a few months before he or she can breathe comfortably while exercising.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17479441\">",
"      <span class=\"h1\">",
"       How should I take care of my child at home?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Try to keep your child as comfortable as possible, and make sure that he or she gets lots of rest. You should also give your child plenty of fluids to drink. For babies and very young children, it might help to offer small amounts of fluids frequently (instead of large amounts less often).",
"     </p>",
"     <p>",
"      Medicines such as",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?19/35/20021?source=see_link\">",
"       acetaminophen",
"      </a>",
"      (sample brand name: Tylenol) or",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?14/17/14614?source=see_link\">",
"       ibuprofen",
"      </a>",
"      (sample brand names: Advil, Motrin) can help relieve pain and discomfort caused by fever. The correct dose depends on your child&rsquo;s weight, so ask your child&rsquo;s doctor how much to give.",
"     </p>",
"     <p>",
"      Do not give your child medicines that quiet a cough. These medicines do not usually work well, and they can have serious side effects in children. Also, do not give",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?6/12/6342?source=see_link\">",
"       aspirin",
"      </a>",
"      or medicines that contain aspirin to children younger than 18 years. In children, aspirin can cause a serious problem called Reye syndrome.",
"     </p>",
"     <p>",
"      Call your child&rsquo;s doctor or nurse if your child does not seem to be getting better after 2 days. Your child might need a different type of treatment.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17479456\">",
"      <span class=\"h1\">",
"       What can I do to keep my child from getting pneumonia again?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Wash your child&rsquo;s hands often with soap and water. It is 1 of the best ways to prevent the spread of infection. You can use an alcohol rub instead, but make sure the hand rub gets everywhere on your child&rsquo;s hands.",
"     </p>",
"     <p>",
"      There are several vaccines that help to protect against pneumonia. Talk to your child&rsquo;s doctor or nurse about which vaccines your child should get, and when he or she should get them.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17479473\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
