"      <a class=\"contributor contributor_credentials\" href=\"UTD.htm?13/44/14020/contributors\" id=\"se1864\">",
"       Douglas R Nordli, Jr, MD",
"      </a>",
"      <a class=\"contributor contributor_credentials\" href=\"UTD.htm?13/44/14020/contributors\" id=\"se154\">",
"       Richard G Bachur, MD",
"      </a>",
"     </td>",
"     <td>",
