"       Deputy Editor",
"      </a>",
"      <a class=\"contributor contributor_credentials\" href=\"UTD.htm?13/44/14020/contributors\" id=\"de2105\">",
"       James F Wiley, II, MD, MPH",
"      </a>",
"     </td>",
"    </tr>",
"   </table>",
"  </div>",
