var title_f13_44_14029="Osteogenic sarcomas";
var content_f13_44_14029=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F70051&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F70051&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    The family of osteogenic sarcomas",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Tumor",
"       </td>",
"       <td class=\"subtitle1\">",
"        Usual age at diagnosis",
"       </td>",
"       <td class=\"subtitle1\">",
"        Common primary sites",
"       </td>",
"       <td class=\"subtitle1\">",
"        Radiographic appearance",
"       </td>",
"       <td class=\"subtitle1\">",
"        Distinctive features",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical course",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Osteosarcoma&nbsp;",
"       </td>",
"       <td colspan=\"1\" rowspan=\"5\">",
"        Second and third decade",
"       </td>",
"       <td colspan=\"1\" rowspan=\"5\">",
"        Around knee joint and shoulder",
"       </td>",
"       <td colspan=\"1\" rowspan=\"5\">",
"        Variable, depending on degree of mineralization of osteoid",
"       </td>",
"       <td colspan=\"1\" rowspan=\"5\">",
"        Tumor osteoid present; variable degrees of osteo-blastic, chondro-blastic, and fibroblastic differentiation",
"       </td>",
"       <td colspan=\"1\" rowspan=\"5\">",
"        Early dissemination to lungs &plusmn; skeleton",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        Conventional",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Osteoblastic&nbsp;&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Chondroblastic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Fibroblastic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Telangiectatic",
"       </td>",
"       <td>",
"        Second and third decade",
"       </td>",
"       <td>",
"        Similar to conventional osteosarcoma",
"       </td>",
"       <td>",
"        Predominantly lytic lesion with little or no sclerosis",
"       </td>",
"       <td>",
"        Cystic, cavity-like tumor; blood-filled spaces in tumor",
"       </td>",
"       <td>",
"        Similar to conventional osteosarcoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Small cell",
"       </td>",
"       <td>",
"        Second and third decade",
"       </td>",
"       <td>",
"        Similar to conventional osteosarcoma",
"       </td>",
"       <td>",
"        May be predominantly lytic",
"       </td>",
"       <td>",
"        May be confused with Ewing's sarcoma",
"       </td>",
"       <td>",
"        Similar to conventional osteosarcoma; radioresponsive",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Multifocal",
"       </td>",
"       <td>",
"        -",
"       </td>",
"       <td>",
"        Synchronous involvement of multiple bones",
"       </td>",
"       <td>",
"        Multiple skeletal sites showing densely sclerotic lesions",
"       </td>",
"       <td>",
"        ? Multiple primary tumors vs. metastatic primary tumor",
"       </td>",
"       <td>",
"        Uniformly fatal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Parosteal (juxtacortical osteosarcoma)",
"       </td>",
"       <td>",
"        Third decade or older",
"       </td>",
"       <td>",
"        Posterior aspect of distal femur",
"       </td>",
"       <td>",
"        Arises from cortex; encircles involved bone; pronounced ossification",
"       </td>",
"       <td>",
"        Low-grade tumor with characteristic radiograph and pathology",
"       </td>",
"       <td>",
"        Indolent clinical course with low propensity for metastases",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Periosteal (juxtacortical chondro-sarcoma)",
"       </td>",
"       <td>",
"        First-seventh decade",
"       </td>",
"       <td>",
"        Tibia and femur",
"       </td>",
"       <td>",
"        Tumor located superficially in cortex",
"       </td>",
"       <td>",
"        Tumor limited to periphery of cortex",
"       </td>",
"       <td>",
"        Intermediate prognosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Fibrosarcoma",
"       </td>",
"       <td>",
"        Second-sixth decade",
"       </td>",
"       <td>",
"        Similar to osteosarcoma",
"       </td>",
"       <td>",
"        Usually lytic",
"       </td>",
"       <td>",
"        Spindle cells and collagen but no osteoid",
"       </td>",
"       <td>",
"        Similar to osteosarcoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Chondrosarcoma",
"       </td>",
"       <td>",
"        Third-seventh decade; usually older adults",
"       </td>",
"       <td>",
"        Most in trunk (especially pelvis) and proximal limbs",
"       </td>",
"       <td>",
"        Bone destruction and fluffy calcification",
"       </td>",
"       <td>",
"        Prolonged history of symptoms - proliferating tissue is fully developed cartilage without tumor osteoid",
"       </td>",
"       <td>",
"        Metastases rare but may appear many years later",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Link MP, Gebhardt MC, Meyers PA. Osteosarcoma. In: Principles and Practice of Pediatric Oncology, 4th ed, Pizzo PA, Poplack DG (Eds), Lippincott Williams &amp; Wilkins, Philadephia 2002. Copyright &copy; 2002 Lippincott Williams &amp; Wilkins",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.lww.com\">",
"      file://www.lww.com",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f13_44_14029=[""].join("\n");
