" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Type II acromioclavicular joint sprain",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 430px; height: 301px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The drawing depicts a type two acromioclavicular (AC) sprain. The AC ligament is completely disrupted, but there is only a partial tear or stretching of the coracoclavicular ligament. Superior displacement of the clavicle, if present at all, is minimal.",
"    <div class=\"footnotes\">",
